import styles from "./RosterCard.module.scss";

export default function RosterCard({ background, name, position, number }) {
  return (
    <div className={styles.rosterCard}>
      <div className={styles.rosterDescription}>
        <div className={styles.rosterName}>
          <h3 className={styles.name}>{name}</h3>
        </div>
        <p className={styles.descInfo}>
          <span className={styles.title}>{position}</span>
          {number}
        </p>
        <p className={styles.descTeam}>Playoffs Music Group</p>
      </div>
      <div
        className={styles.rosterPic}
        styles={{ backgroundImage: `url(${background})` }}
      ></div>
    </div>
  );
}
